Skin infections are a really common chief complaint in urgent care. I‚Äôve seen anything from sepsis due to a cat bite, necrotizing fasciitis, to your typical abscesses & cellulitis. It is important to know which bacteria are associated with each infection, as your antibiotics must cover for the suspected bacteria‚Å£
