Key notes: ‚Å£
üî∏do not confuse stasis dermatitis with cellulitis‚Å£
üîπCellulitis is most commonly caused by: streptococci‚Å£
üî∏Cat bites have a higher tendency to become infected‚Å£
üîπTime to onset of infection for dog bites: 24 hours‚Å£
üî∏Time to onset of infection for cat bites: 12 hours‚Å£
üîπimportant bacteriology for cat/dog bites: Pasteurella (along with mixed flora)‚Å£
üîπLaceration over a knuckle is considered a fight bite until proven otherwise‚Äîthere is a really good legal case on UC rap about this!‚Å£
üî∏Important bacteriology for human bites: Eikenella (along with mixed flora)‚Å£
üîπBounce-backs for skin infections often occur due to incorrect antibiotic coverage or presence of abscess that must be drained‚Å£
